-- SQL Mastery 30: Subscription Database (SQLite)
-- Auto-generated for browser execution
-- Prefixed with sub_ to avoid conflicts with ecommerce tables

CREATE TABLE IF NOT EXISTS sub_users (
    user_id INTEGER PRIMARY KEY AUTOINCREMENT,
    signup_date TEXT NOT NULL,
    plan_type TEXT NOT NULL CHECK (plan_type IN ('free', 'basic', 'premium'))
);

CREATE TABLE IF NOT EXISTS subscriptions (
    subscription_id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER NOT NULL REFERENCES sub_users(user_id),
    start_date TEXT NOT NULL,
    end_date TEXT,
    plan_type TEXT NOT NULL CHECK (plan_type IN ('free', 'basic', 'premium')),
    status TEXT NOT NULL CHECK (status IN ('active', 'cancelled', 'expired'))
);

CREATE TABLE IF NOT EXISTS events (
    event_id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER NOT NULL REFERENCES sub_users(user_id),
    event_date TEXT NOT NULL,
    event_type TEXT NOT NULL
);

CREATE INDEX IF NOT EXISTS idx_sub_users_signup ON sub_users(signup_date);
CREATE INDEX IF NOT EXISTS idx_subscriptions_user ON subscriptions(user_id);
CREATE INDEX IF NOT EXISTS idx_subscriptions_status ON subscriptions(status);
CREATE INDEX IF NOT EXISTS idx_events_user ON events(user_id);
CREATE INDEX IF NOT EXISTS idx_events_date ON events(event_date);
CREATE INDEX IF NOT EXISTS idx_events_type ON events(event_type);



